import React from "react";

const ToDoList = (props) =>{
 
     
    return(
        <>
        <ul>
        <li>
        <div>
        <button className="Delete" onClick={props.onSelect}>Delete</button>
              {props.text}  </div>
        </li> 
        </ul>
        </>
    );
};

export default ToDoList;
